import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Route,Switch} from 'react-router-dom'
import LoginComponent from './components/login/login.component';
import RegisterComponent from './components/register/register.component';
import AddItemsToCartComponent from './components/addLaptop/addItemsToCart.component';

function App() {
  return (
    <Router>
      <Switch>
        <Route path ='/Login'>
          <LoginComponent/>
        </Route>
        <Route path= '/Register'>
          <RegisterComponent />
        </Route>
        <Route path = 'AddItemsToCart'>
          <AddItemsToCartComponent />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
